INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "ヒヨリ", "A", 100101, "人助け、応援", "トゥインクルウィッシュ", 155, "人助けが大好き！　前向き格闘娘", 0, 27, 2, 44, 16, "東山奈央", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ユイ", "O", 100201, "料理、人間観察", "トゥインクルウィッシュ", 158, "戦闘のサポートが得意な、心優しい少女", 0, 5, 2, 47, 17, "種田梨沙", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "レイ", "B", 100301, "読書、乗馬、お茶", "トゥインクルウィッシュ", 163, "クールで何事にも真っ直ぐな剣士", 0, 12, 2, 46, 18, "早見沙織", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ミソギ", "O", 100401, "いたずら、探検", "リトルリリカル", 128, "探検好きのイタズラっ子", 0, 10, 5, 27, 9, "諸星すみれ", 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "マツリ", "O", 100501, "ヒーローごっこ", "王宮騎士団（NIGHTMARE）", 146, "ヒーローに憧れる騎士見習いの少女", 0, 25, 8, 40, 12, "下田麻美", 11, "？？？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "アカリ", "O", 100601, "サックス", "悪魔偽王国軍（ディアボロス）", 150, "甘え上手なみんなの人気者", 0, 22, 7, 42, 13, "浅倉杏美", 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "ミヤコ", "B", 100701, "プリンを食べること", "悪魔偽王国軍（ディアボロス）", 130, "プリン大好きゴースト娘", 0, 23, 7, 32, 14, "雨宮天", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "ユキ", "AB", 100801, "鏡で自分を見ること", "ヴァイスフリューゲル　ランドソル支部", 150, "ボクは誰よりも美しい", 0, 10, 15, 40, 14, "大空直美", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "アンナ", "A", 100901, "小説執筆", "トワイライトキャラバン", 159, "前世を信じる中二病患者、「疾風の冥姫」", 0, 5, 13, 45, 17, "髙野麻美", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "マホ", "O", 101001, "空想、ぬいぐるみ集め", "自警団（カォン）", 155, "マホマホ王国のプリンセス", 0, 22, 10, 42, 16, "内田真礼", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "リノ", "A", 101101, "お裁縫", "ラビリンス", 156, "人懐っこくてマシンガントークな妹系少女", 0, 25, 3, 44, 15, "阿澄佳奈", 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "ハツネ", "A", 101201, "妹と遊ぶこと、二度寝、昼寝、早寝", "フォレスティエ", 156, "みんなのために超能力を使う眠り姫", 0, 24, 6, 46, 17, "大橋彩香", 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！");
