INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "ミサト", "O", 101501, "絵本作り", "フォレスティエ", 165, "母性溢れる優しいみんなの「ミサト先生」", 0, 5, 6, 54, 21, "國府田マリ子", 9, "test");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "スズナ", "O", 101601, "ファッション", "ルーセント学院", 167, "天真爛漫で人気者のカリスマモデル", 0, 10, 14, 48, 18, "上坂すみれ", 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "カオリ", "A", 101701, "踊り、空手", "自警団（カォン）", 158, "いつでも「なんくるないさ～」な天然娘", 0, 7, 10, 53, 19, "高森奈津美", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "イオ", "B", 101801, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "ルーセント学院", 162, "多くの男性を魅了する無垢な女教師", 0, 14, 14, 52, 23, "伊藤静", 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "ミミ", "O", 102001, "かわいいもの集め", "リトルリリカル", 117, "お歌もにんじんも、ウサギさんも大好き♪", 0, 3, 5, 21, 10, "日高里菜", 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "クルミ", "B", 102101, "観劇、おままごと", "サレンディア救護院", 150, "泣き虫で臆病な守ってあげたい女の子", 0, 9, 9, 40, 12, "植田佳奈", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "ヨリ", "O", 102201, "ゲーム全般", "悪魔偽王国軍（ディアボロス）", 150, "人見知りであまのじゃくな女の子", 0, 22, 7, 40, 13, "原紗友里", 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "アヤネ", "B", 102301, "屋内でできる遊び", "サレンディア救護院", 148, "ぷうきちといつも一緒！", 0, 10, 9, 38, 14, "芹澤優", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "スズメ", "O", 102501, "ご奉仕", "サレンディア救護院", 154, "お嬢さまのためにがんばるドジっ娘メイド", 0, 12, 9, 43, 15, "悠木碧", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "リン", "B", 102601, "あんパン", "牧場（エリザベスパーク）", 144, "遊びと睡眠が何より大事なぐうたら娘", 0, 1, 11, 42, 17, "小岩井ことり", 1, "test");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "エリコ", "B", 102701, "実験、裁縫、料理", "トワイライトキャラバン", 154, "運命の相手に一途すぎる乙女", 0, 30, 13, 43, 16, "橋本ちなみ", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "サレン", "A", 102801, "経営、お茶会", "サレンディア救護院", 156, "救護院を経営する優しい庶民派お嬢様", 0, 4, 9, 43, 17, "堀江由衣", 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ノゾミ", "B", 102901, "舞台鑑賞、ダンス", "カルミナ", 157, "歌って踊れる大人気アイドル", 0, 24, 4, 40, 17, "日笠陽子", 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ニノン", "O", 103001, "忍法開発", "ヴァイスフリューゲル　ランドソル支部", 163, "トーゴクの神秘、オシエテクダサイ！", 0, 31, 15, 51, 16, "佐藤聡美", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "シノブ", "AB", 103101, "占い", "悪魔偽王国軍（ディアボロス）", 157, "占いが得意な霊能少女", 0, 22, 7, 42, 18, "大坪由佳", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "アキノ", "AB", 103201, "慈善事業", "メルクリウス財団", 157, "一人前の商人を目指すパワフルお嬢様", 0, 12, 12, 45, 18, "松嵜麗", 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "マヒル", "B", 103301, "漫才", "牧場（エリザベスパーク）", 142, "みんなを笑顔にするお笑い牧場主", 0, 3, 11, 35, 20, "新田恵海", 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "ユカリ", "A", 103401, "ウインドーショッピング", "メルクリウス財団", 164, "純情でほっとけない大人の女性", 0, 16, 12, 55, 22, "今井麻美", 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "キョウカ", "A", 103601, "お勉強", "リトルリリカル", 118, "礼儀正しくしっかり者のちびっ子優等生", 0, 2, 5, 21, 8, "小倉唯", 2, "test");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "トモ", "A", 103701, "剣術、年長者をからかう", "王宮騎士団（NIGHTMARE）", 149, "義理堅くてからかい好きな剣術少女", 0, 11, 8, 43, 13, "茅原実里", 8, "test");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "シオリ", "A", 103801, "読書、お散歩", "牧場（エリザベスパーク）", 153, "読書が趣味の病弱少女", 0, 3, 11, 40, 14, "小清水亜美", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("エルフ", "アオイ", "AB", 104001, "友達作りのイメトレ", "フォレスティエ", 158, "「友達」に憧れる、エルフの森の女の子", 0, 6, 6, 44, 13, "花澤香菜", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "チカ", "O", 104201, "各種楽器", "カルミナ", 163, "人々を守るために歌う、唱喚士の少女", 0, 3, 4, 46, 17, "福原綾香", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
