INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "イリヤ", "A", 104401, "世界征服", "悪魔偽王国軍（ディアボロス）", 172, "かつては夜を支配した最強の吸血鬼", 0, 5, 7, 50, "??", "丹下桜", 5, "test");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "クウカ", "AB", 104501, "小説を読むこと", "ヴァイスフリューゲル　ランドソル支部", 157, "妄想大好き！　ほんとは照れ屋な女の子", 0, 19, 15, 49, 18, "長妻樹里", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "タマキ", "AB", 104601, "猫とたわむれること", "メルクリウス財団", 158, "弱きを助け強きをくじく猫娘", 0, 1, 12, 48, 18, "沼倉愛美", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ジュン", "A", 104701, "格闘技、湯浴み", "王宮騎士団（NIGHTMARE）", 171, "素顔を見せない冷静沈着な女性騎士", 0, 25, 8, 50, 25, "川澄綾子", 10, "？？？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ミフユ", "O", 104801, "傭兵などのアルバイト", "メルクリウス財団", 163, "仕事も私事も効率優先な傭兵少女", 0, 11, 12, 49, 20, "田所あずさ", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "シズル", "O", 104901, "家事全般", "ラビリンス", 168, "お姉ちゃんがお世話してあげるからねっ！", 0, 24, 3, 54, 18, "生天目仁美", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "ミサキ", "A", 105001, "ファッション誌鑑賞、コスメ集め", "ルーセント学院", 120, "ちょっとおませな恋に恋する女の子", 0, 3, 14, 22, 11, "久野美咲", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ミツキ", "A", 105101, "研究、実験", "トワイライトキャラバン", 166, "実験が趣味の危険な科学者", 0, 7, 13, 53, 27, "三石琴乃", 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "リマ", "A", 105201, "毛繕い、お喋り", "牧場（エリザベスパーク）", 150, "乙女チックなもふもふアニマル", 0, 14, 11, 100, 18, "徳井青空", 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "モニカ", "A", 105301, "お菓子屋通い", "ヴァイスフリューゲル　ランドソル支部", 140, "見た目も中身もお子ちゃまな異国の軍人", 0, 28, 15, 33, 18, "辻あゆみ", 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！");
