INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ジータ", "O", 105701, "冒険、おしゃべり", "？？？", 156, "空への冒険を夢見る騎空士の少女", 0, 10, "", 45, 17, "金元寿子", 3, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ペコリーヌ", "O", 105801, "食べ歩き、料理", "美食殿", 156, "いつも元気な腹ペコ少女", 0, 31, 1, 46, 17, "M・A・O", 3, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…");
