INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "キャル", "A", 106001, "猫と遊ぶ", "美食殿", 152, "行き倒れの謎のネコミミ魔法使い", 0, 2, 1, 39, 14, "立花理香", 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！");
