INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "キャル（サマー）", "A", 107801, "猫と遊ぶ", "美食殿", 152, "行き倒れの謎のネコミミ魔法使い", 0, 2, 1, 39, 14, "立花理香", 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "タマキ（サマー）", "AB", 107901, "猫とたわむれること", "メルクリウス財団", 158, "弱きを助け強きをくじく猫娘", 0, 1, 12, 48, 18, "沼倉愛美", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ミフユ（サマー）", "O", 108001, "傭兵などのアルバイト", "メルクリウス財団", 163, "仕事も私事も効率優先な傭兵少女", 0, 11, 12, 49, 20, "田所あずさ", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "シノブ（ハロウィン）", "AB", 108101, "占い", "悪魔偽王国軍（ディアボロス）", 157, "占いが得意な霊能少女", 0, 22, 7, 42, 18, "大坪由佳", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "ミヤコ（ハロウィン）", "B", 108201, "プリンを食べること", "悪魔偽王国軍（ディアボロス）", 130, "プリン大好きゴースト娘", 0, 23, 7, 32, 14, "雨宮天", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "ミサキ（ハロウィン）", "A", 108301, "ファッション誌鑑賞、コスメ集め", "ルーセント学院", 120, "ちょっとおませな恋に恋する女の子", 0, 3, 14, 22, 11, "久野美咲", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "チカ（クリスマス）", "O", 108401, "各種楽器", "カルミナ", 163, "人々を守るために歌う、唱喚士の少女", 0, 3, 4, 46, 17, "福原綾香", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "クルミ（クリスマス）", "B", 108501, "観劇、おままごと", "サレンディア救護院", 150, "泣き虫で臆病な守ってあげたい女の子", 0, 9, 9, 40, 12, "植田佳奈", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "アヤネ（クリスマス）", "B", 108601, "屋内でできる遊び", "サレンディア救護院", 148, "ぷうきちといつも一緒！", 0, 10, 9, 38, 14, "芹澤優", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("獣人族", "ヒヨリ（ニューイヤー）", "A", 108701, "人助け、応援", "トゥインクルウィッシュ", 155, "人助けが大好き！　前向き格闘娘", 0, 27, 2, 44, 16, "東山奈央", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ユイ（ニューイヤー）", "O", 108801, "料理、人間観察", "トゥインクルウィッシュ", 158, "戦闘のサポートが得意な、心優しい少女", 0, 5, 2, 47, 17, "種田梨沙", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "レイ（ニューイヤー）", "B", 108901, "読書、乗馬、お茶", "トゥインクルウィッシュ", 163, "クールで何事にも真っ直ぐな剣士", 0, 12, 2, 46, 18, "早見沙織", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("魔族", "エリコ（バレンタイン）", "B", 109001, "実験、裁縫、料理", "トワイライトキャラバン", 154, "運命の相手に一途すぎる乙女", 0, 30, 13, 43, 16, "橋本ちなみ", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "シズル（バレンタイン）", "O", 109101, "家事全般", "ラビリンス", 168, "お姉ちゃんがお世話してあげるからねっ！", 0, 24, 3, 54, 18, "生天目仁美", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "アン", "AB", 109201, "読書", "？？？", 156, "英霊と契約を結んだマナリアの天才王女", 0, 1, "", 55, 17, "日笠陽子", 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ルゥ", "O", 109301, "食べること、眠ること", "？？？", 144, "マナリア魔法学院の新入生", 0, 4, "", 45, 15, "こやまきみこ", 2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("半人半竜", "グレア", "B", 109401, "ピアノ", "？？？", 167, "人を超越した力を有す心優しい竜姫", 0, 3, "", 67, 17, "福原綾香", 11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "クウカ（オーエド）", "AB", 109501, "小説を読むこと", "ヴァイスフリューゲル　ランドソル支部", 157, "妄想大好き！　ほんとは照れ屋な女の子", 0, 19, 15, 49, 18, "長妻樹里", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("ヒューマン", "ニノン（オーエド）", "O", 109601, "忍法開発", "ヴァイスフリューゲル　ランドソル支部", 163, "トーゴクの神秘、オシエテクダサイ！", 0, 31, 15, 51, 16, "佐藤聡美", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！");
